column1:
친구중에 저렇게 귀여운 친구 애교 타고난 친구들 있잖아요.
저분도 그러신 분들 중 한분이신것 같은데 좀 작작 욕하세요; 
ㅏ 친구없으면 모를라나?

뭐가 못나서 그러는건지 토라진 분들이 많은거같은데 이쁘기만하구만 왜 남의 얼굴대놓고 방구석에서 잘낫네 못낫네 평가하고따지는지 알수가없네요;;
토론할시간 있으면 본인 판대기나 관리하세요!!
글구 민정님 넘이뻐용ㅎㅎ♡♡

그냥 부러우면 부럽다고해 존나 까대고 지랄이네 렌즈가 뭔 화장의 반이야 평소에 렌즈안끼고 다니는 사람들은 화장을 반만하고 돌아댕기는거냐? 이상한 논리에 빠져서 저게 생얼이 아니라고 빼액거리지좀 마라;
입술을 내밀던지 말던지 불편하면 그냥 영상 보지마세요ㅋ난 귀엽기만 하구만
양심에 손을 얹고 생각해라 아무리 렌즈끼고 속눈썹연장했더라도 저 정도 얼굴이면 그냥 이쁜거야

ㅋㅋㅋㅋㅋ 댓글수준봐 그렇게 달아놓고 남자들댓글보고 여우짓인데 모른다고 혼자 ㅂㄷㅂㄷ 이러니 여자 남자 이러면서 서로서로 욕하고 욕먹고 ;; 첨부터 들어와서 보질말던가 지들보라고 올린거 아닐텐데 ; 
카메라 앞에서 이쁘게 찍히고싶은거 당연한건데 귀여운척이니 이쁜척이니 별에 별 시비를 다거네 
개인채널에 자기 영상하나 올리는게 그렇게 잘못된일인가 ㅠㅠ 사진이랑 영상이랑 다를수도있지 지들도 완벽하게 이쁜 얼굴 아니면서 .. 얼굴까고 다들 이쁘다 인정하면 내가 입다물게요 ㅎㅎ 다들 혼자서 핸드폰 붙잡고 열내면서 자격지심 가져봐요 화이팅 ‼️
